          "scopecontent" => %{
            "head" => "Content Description",
            "id" => "aspace_e636622b1f836532b4f3ccfe9afe42ff",
            "p" => [
              "The archival collection is divided into 3 series.",
              "The first series is Wildlife research and conservation projects. It consists of sub-series:",
              "1) Field research and data collection which contains letters, notes, maps, articles, media clippings and more material collected and/or created by BC Choudhary while working on the Andhra Pradesh Crocodile Conservation Project (APCC) - an initiative by Andhra Pradesh Forest Department and FAO/UNDP to survey states across India to tackle the issue of all three species of Indian crocodiles (Mugger, Estuarine, and Gharial) becoming rare.",
              "2) Research writings and publications, which consist of research notes, drafts, and publications. \nstudy tours, meetings, and symposiums, which consists of notes taken, schedules of meetings and correspondence regarding the meetings and symposia.",
              "The second series, Correspondence, which is arranged chronologically.",
              "The final and third series are Research references and personal collections. \nThe sub-series in this are:  \ni) Books and booklets,\nii) project documents and reports, \niii) Souvenirs, \niv) Periodicals, \nv) Articles, excerpts, and other references, and \nvi) Media Clippings."
            ]
          }
        },
